/// privacy_ar : "<h1 dir=\"rtl\"><strong>سياسة الخصوصية</strong></h1>\r\n\r\n<p dir=\"rtl\"><strong>يرحّب بكم فريق عمل متجر محمود سي ويتقدّم إليكم بالشكر على ثقتكم به، ويفيدكم&nbsp; أنه حرصاً منه و لإدراكه التام بأن المستخدم له حقوق، فإنه&nbsp; يسعى للحفاظ على المعلومات الخاصة بالمستخدمين وفقاً لآلية سياسة الخصوصية وسرية المعلومات المعمول بها . وعليه فإنه يوضّح لكم بأن سياسة الخصوصية وسرية المعلومات التي سيتم التعامل مع معلوماتكم الخاصة بكم بموجبها كما يلي:&nbsp;</strong></p>\r\n\r\n<p dir=\"rtl\"><strong>أولاً: المعلومات التي تحصل عليها متجر محمود سي وتحتفظ بها في قواعد بياناتها&nbsp;</strong></p>\r\n\r\n<p dir=\"rtl\">١. المعلومات الشخصية الخاصة بالمستخدم، كالإسم والعمر والبريد الالكتروني</p>\r\n\r\n<p dir=\"rtl\">2. معلومات الدخول الشخصية الخاصة بالمستخدم، مثل اسم المستخدم وكلمة السر والبريد الالكتروني</p>\r\n\r\n<p dir=\"rtl\"><strong>ثانياً: هل متجر محمود سي&nbsp;يشارك هذه المعلومات؟&nbsp;</strong></p>\r\n\r\n<p dir=\"rtl\">- بطبيعة الحال فإن المتجر يسعى بالاحتفاظ بهذه المعلومات بما يحفظ خصوصية المستخدم</p>\r\n\r\n<p dir=\"rtl\">- بهدف تحسين جودة المتجر الإلكتروني وتيسير التعامل فيما بين المتجر والمستخدم.&nbsp;</p>\r\n\r\n<p dir=\"rtl\">- كقاعدة عامة فإن جميع هذه المعلومات لا تطلع عليها إلا القائمين على متجر محمود&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><strong>ثالثاً: ما هو مدى أمان سرية المعلومات الخاصة بالمتجر؟&nbsp;</strong></p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:right\">١- يسعى متجر محمود سي&nbsp; إلى سرية المعلومات وسياسة الخصوصية الخاصة بالمستخدمين و لن تخالف أحكام هذه القواعد والسياسة. ولكن نظراً لعدم إمكانية ضمان ذلك 100% عبر وسائل الإنترنت فإن فريق عمل المتجر ينوّه بما يلي:&nbsp;&nbsp;</p>\r\n\r\n<p dir=\"rtl\">٢. يسعى متجر محمود سي&nbsp; بالحفاظ على جميع المعلومات الخاصة بالمستخدم وألا يطلع عليها أحد بما يخالف هذه السياسة المعمول بها في متجر</p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>"
/// privacy_en : "<p><strong>privacy policy<br />\r\nThe Mahmood Si Store team welcomes you and thanks you for your trust in it, and informs you that out of the interest of it and its full awareness that the user has rights, it seeks to preserve the information of users in accordance with the applicable privacy policy and information confidentiality mechanism. Accordingly, it is clarified to you that the privacy policy and confidentiality of information under which your information will be dealt with is as follows:</strong></p>\r\n\r\n<p><strong>First: The information that Mahmoud Si Store obtains and maintains in its databases</strong></p>\r\n\r\n<p><strong>1. User&#39;s personal information, such as name, age, and e-mail</strong></p>\r\n\r\n<p><strong>2. The user&#39;s personal login information, such as the user name, password and e-mail</strong></p>\r\n\r\n<p><strong>Second: Does Mahmoud Si store share this information?</strong></p>\r\n\r\n<p><strong>- Of course, the store seeks to keep this information in a way that preserves the privacy of the user</strong></p>\r\n\r\n<p><strong>- With the aim of improving the quality of the online store and facilitating the interaction between the store and the user.</strong></p>\r\n\r\n<p><strong>- As a general rule, all this information is only available to those in charge of Mahmoud Store</strong></p>\r\n\r\n<p><strong>Third: How secure is the confidentiality of the store&#39;s information?</strong></p>\r\n\r\n<p><strong>1- Mahmood Si Store seeks to keep the information and privacy policy of users confidential and will not violate the provisions of these rules and policy. However, since it is not possible to guarantee this 100% via the Internet, the store staff notes the following:</strong></p>\r\n\r\n<p><strong>2. Mahmoud Si Store strives to preserve all user information and not to be viewed by anyone in violation of this policy applicable to the store<br />"
/// privacy_kr : "<p>privacy policy<br />\r\nPrivacy Policy and Confidentiality of Information<br />\r\n&nbsp;<br />\r\nThe Mahmood Si Store team welcomes you and thanks you for your trust in it, and informs you that in order to ensure that the user is fully aware that the user has rights, he seeks to preserve the information of users in accordance with the applicable privacy policy and information confidentiality mechanism. Accordingly, it is clarified to you that the privacy policy and confidentiality of information under which your information will be dealt with is as follows:<br />\r\n&nbsp;<br />\r\n&nbsp; &nbsp;&nbsp;<br />\r\nFirst: The information that Mahmoud Si Store obtains and maintains in its databases<br />\r\nUser&#39;s personal information, such as name, age, and e-mail<br />\r\n2. The user&#39;s personal login information, such as the user name, password and e-mail<br />\r\nSecond: Does Kimable store share this information?<br />\r\nOf course, the store seeks to keep this information in order to preserve the privacy of the user<br />\r\n&nbsp;With the aim of improving the quality of the online store and facilitating the interaction between the store and the user.<br />\r\nAs a general rule, all this information is only available to those in charge of Mahmoud Store<br />\r\nSince Mahmoud Si Store seeks to preserve the safety of users, it - in the event of any irregular or illegal activity by the user - informs the competent authorities.<br />\r\n&nbsp;<br />\r\nThird: How secure is the confidentiality of the store&#39;s information?<br />\r\nMahmoud Si Store seeks to keep the information and privacy policy of users confidential and will not violate the provisions of these rules and policy. However, since it is not possible to guarantee this 100% via the Internet, the store staff notes the following:<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\nMahmoud Si Store strives to preserve all user information and not to be viewed by anyone in violation of this policy in force in the store<br />\r\nAre you working to protect this information by &quot;certain servers?&quot; Protected by electronic protection systems &quot;Special software?&quot;.</p>"
/// terms_ar : "<p>قد نحتاج لجمع المعلومات الخاصة بكَ إذا أردت تسجيل طلبية شراءٍ لسلعةٍ من موقعنا.ونقوم بجمع بعض البيانات اللازمة لتأمين أية مطالب محتملة قد تظهر لاحقاً&shy;، ولتزويدكَ بالخدمات المتوفرة لدينا. مثال على ذلك ، الإسم والجنس وتاريخ الميلاد وعنوان البريد الإلكتروني والعنوان البريدي وعنوان التسليم (إذا كان مختلفاً) ورقم الجوّال وتفاصيل الدفع &quot;أي تفاصيل عن بطاقات&nbsp;الدفع أو تفاصيل عن الحساب المصرفي&quot;.<br />\r\nتستخدم المعلومات التي تقدّمها لتزويدكَ بمعلومات حول المنتجات والخدمات المتوفرة لدينا والتي تطلبها ، وللتحقّقَ من المعاملات المالية التي تُجريها على الإنترنت وإدارة حسابك الخاص لدى &quot;&#39;طلباتي&quot;. كما تستخدم هذه المعلومات في عمليات تدقّيقَ تحميل البيانات من الموقع وتحديد هويّة زائري الموقع ، وتطوير تصاميم صفحات الموقع و / أو محتوياته وتخصيصها للمستخدمين.<br />\r\nويتم التواصل عبر البريد الإلكتروني لتزويدكَ ببعض التفاصيل حول المنتجات والخدمات الأخرى إذا كنت ترغب في ذلك، وإذا كنتَ تفضّل عدم تلقي أية مراسلات ترويجية وتسويقيّةٍ ، فيُرجى الانسحاب من هذا الخيارفي أي وقتٍ من الأوقات.</p>"
/// terms_en : "<p>We may need to collect your information if you want to place an order for a commodity from our site. We collect some data necessary to secure any potential claims that may arise later, and to provide you with the services available to us. Examples are name, gender, date of birth, email address, postal address, delivery address (if different), mobile number, payment details &quot;any payment card details or bank account details&quot;.<br />\r\nThe information you provide is used to provide you with information about the products and services available to us that you request, to verify your online financial transactions and to manage your account with &ldquo;My Talabat&rdquo;. This information is also used in the processes of downloading data from the site, identifying visitors to the site, and developing and customizing the designs of site pages and/or content for users.<br />\r\nWe will contact you via e-mail to provide you with some details about other products and services if you wish, and if you would prefer not to receive any promotional and marketing communications, please opt out of this option at any time</p>"
/// terms_kr : "<p>Vi kan beh&ouml;va samla in din information om du vill g&ouml;ra en best&auml;llning f&ouml;r en vara fr&aring;n v&aring;r webbplats. Vi samlar in vissa uppgifter som kr&auml;vs f&ouml;r att s&auml;kerst&auml;lla eventuella p&aring;st&aring;enden som kan uppst&aring; senare och f&ouml;r att ge dig de tj&auml;nster som &auml;r tillg&auml;ngliga f&ouml;r oss. Exempel &auml;r namn, k&ouml;n, f&ouml;delsedatum, e -postadress, postadress, leveransadress (om olika), mobilnummer, betalningsuppgifter &quot;Alla uppgifter om betalningskort eller bankkontouppgifter&quot;.<br />\r\nInformationen du tillhandah&aring;ller anv&auml;nds f&ouml;r att ge dig information om de produkter och tj&auml;nster som finns tillg&auml;ngliga f&ouml;r oss som du beg&auml;r, f&ouml;r att verifiera dina finansiella transaktioner online och f&ouml;r att hantera ditt konto med &quot;My Talabat&quot;. Denna information anv&auml;nds ocks&aring; i processerna f&ouml;r att ladda ner data fr&aring;n webbplatsen, identifiera bes&ouml;kare p&aring; webbplatsen och utveckla och anpassa designen p&aring; webbplatssidor och/eller inneh&aring;ll f&ouml;r anv&auml;ndare.<br />\r\nVi kommer att kontakta dig via e-post f&ouml;r att ge dig n&aring;gra detaljer om andra produkter och tj&auml;nster om du vill, och om du f&ouml;redrar att inte f&aring; n&aring;gon marknadsf&ouml;ring och marknadsf&ouml;ringskommunikation, v&auml;nligen v&auml;lj bort det h&auml;r alternativet n&auml;r som helst</p>"
